function WeatherBox(props) {
    const time = typeof(props.time)
    const weatherData = props.weatherData
    return (
        <>
        <h1>{time}</h1>
        <div className='grid-item'><h1>Todays weather: Morning </h1>
        <p>Weather description: {weatherData.weatherDescription[time]}</p>
        <p>Temperature: {weatherData.temperature.Morning} degrees C</p>
        <p>Precipitation: {weatherData.precipitation.Morning}mm</p>
        <p>Humidity: {weatherData.humidity.Morning}%</p>
        <p>Wind Speed: {weatherData.windSpeed.Morning}km/h</p></div>
        </>
    )
}

export default WeatherBox
